import React from 'react'
import styles from "./index.module.css";
function List(props) {
  return (
    <div>
       {
           props.data.map((dat)=>{
               return(
                    <div className={styles["list-item"]}>
       <img src={dat.image} alt="tutt" className={styles.img}></img>
       <div className="info">
         <h5>{dat.name}</h5>
         <p>{dat.age}</p>
       </div> 
      </div>
               )
           })
       }
        
    </div>
  )
}

export default List
